import ProductComp from '../../../components/product/product.component';

const Product = () => {
    return(
        <>
        <Head/>
        <main className="container-fluid">
            <Header/>
            <ProductComp/>
            <Footer/>
        </main>
        </>
    )
}
export default Product;
